const Wrapper = styled.section `
    height:100%
    overflow:scroll;
`
const InnerWrapper = styled.div `
overflow:scroll;
    text-align: center;
    color:red;
`
const SideName = styled.nav `

`
const MainDiv = styled.div `

`
class LandingContentComponent extends React.Component {

  render() {
    return (

        <Wrapper>
            <MainDiv>
                <SideName></SideName>
            </MainDiv>
        </Wrapper>

    )
  }
}

export default withRouter(LandingContentComponent);
